import Data from "./Data"

function Prodact(){
    const arr=Data.map((el)=>{
        return(
            
          el.price>300?
          <div key={el.id}>
            <img src={el.image} alt="" />
            <h1>{el.title}</h1>
            <p>{el.description}</p>
            <p>{el.price}</p>
            </div>:null
        )
    })
    return(
<div>
    {arr}
</div>
    )
}
export default Prodact
